import React from "react";

import { StoryGrid } from "../../../../components/common/Grid";

const StorySearch = () => {
  return (
    <div className="search-page">
      <h2 className="side-heading">Search results for: history</h2>
      <StoryGrid />
    </div>
  );
};

export default StorySearch;
